import Link from 'next/link';

const divStyle = {
  marginLeft: 400,
  marginRight: 400,
}

const linkStyle = {

  marginRight: 20,
  //verticalAlign: 'bottom' ,
};

const logoStyle = {
  marginLeft: 17,
  marginRight: 20,
  //verticalAlign: 'bottom' ,
  width: 100
};

const hrStyle = {
  borderTop: '2px solid #14a3bb',
};

const menuStyle = {
  //marginTop: 40,
  float: 'right',
  verticalAlign: 'ceneter',
}

const Header = () => (
  <div style={divStyle}>

    <Link href="/">
      <a> <img style={logoStyle} src="../static/logo.png"/></a>
    </Link>
    <div style={menuStyle}>
      <Link href="/">
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href="#about">
        <a style={linkStyle}>About</a>
      </Link>
      <Link href="#feature">
        <a style={linkStyle}>Feature</a>
      </Link>
      <Link href="/amazon">
        <a style={linkStyle}>Amazon</a>
      </Link>
    </div>
    <hr style={hrStyle}></hr>
  </div>


);

export default Header;
